# yaml-language-server: $schema=../.schema.yaml
title: Individual Correlates of Infectivity of Influenza A Virus Infections in Households
doi: 10.1371/journal.pone.0154418
description: >
  The community-based study reports the transmission of Influenza A virus within households
  from February 2008 through December 2012, focusing on viral loads in nasal and throat
  swabs from index cases and their household contacts.
analytes:
  NPSOPS:
    description: >
      Influenza A virus RNA gene copy concentration in oropharynx and nasopharynx
      samples. Paired nasal and throat swabs were pooled in viral transport medium
      immediately after collection and subsequently processed for quantitative reverse
      transcription PCR to detect and quantify influenza A virus. The concentration
      was quantified in gene copies per milliliter. M gene was used as the gene target
      for the PCR assay, as described in a referenced study (Chan et al., 2008).
    specimen:
    - nasopharyngeal_swab
    - oropharyngeal_swab
    biomarker: influenza
    gene_target: M
    limit_of_quantification: unknown
    limit_of_detection: 900
    unit: gc/mL
    reference_event: symptom onset
